import React, { useState, useEffect } from "react";
import { fetchData } from "../api/fetchApi";
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import styles from "../table/table.css";
// import TableData from "./TableData";

const Tabular = ({ data: { region } }) => {
    if (!region) {
        return "Loading...";
    }
    console.log(region)
    const [fetchedState, setFetchedState] = useState([])

    useEffect(() => {
        const fetchAPIState = async () => {
            const dailyData = await fetchData()
            setFetchedState(dailyData)
            console.log(dailyData)
        }
        fetchAPIState()
    }, [])

    //console.log(Assam) , Manipur, Meghalaya, Mizoram, Nagaland, Tripura


    // state = {
    //     data: {},
    //     country: '',
    // }

    // async componentDidMount() {
    //     const fetchedData = await fetchData();
    //     this.setState({ data: fetchedData })
    // }
    //  { data: { Arunachal, Assam, Manipur, Meghalaya, Mizoram, Nagaland, Tripura } }

    // const { data, country } = this.state;
    return (
        <>
            {/* <TableData data={data} /> */}
            <TableContainer component={Paper}>
                <Table className={styles.container} aria-label="simple table">
                    <TableHead>
                        <TableRow>
                            <TableCell>State</TableCell>
                            <TableCell className="alert alert-warning" align="right">District</TableCell>
                            <TableCell className="alert alert-success" align="right">Infected</TableCell>

                        </TableRow>
                    </TableHead>
                    <TableBody>
                        <TableCell component="th" scope="row">
                            {fetchedState.map(({ region }, i) => (
                                <TableRow key={i}>
                                    <TableCell component="th" scope="row">
                                        {region.loc}
                                    </TableCell>
                                    <TableCell className="alert alert-warning" align="right">{region.totalConfirmed}</TableCell>
                                    <TableCell className="alert alert-success" align="right">{region.discharged}</TableCell>
                                    <TableCell className="alert alert-danger" align="right">{region.totalConfirmed}</TableCell>
                                </TableRow>
                            ))}
                        </TableCell>
                        {/* {fetchedState.map(({ Assam }, i) => ( */}
                        {/* <TableRow >

                        <TableCell className="alert alert-warning" align="right">{Assam.districtData}</TableCell>
                        <TableCell className="alert alert-success" align="right">{Assam.districtData.Cachar.confirmed}</TableCell>

                    </TableRow> */}
                        {/* ))} */}
                    </TableBody>
                </Table>
            </TableContainer>
        </>
    )

}

export default Tabular
